    return (
        <BrowserRouter>
            <div>
                <a>
                    aaaaa
                </a>

            </div>
            <Switch>
                <Route exact path="/login" component={Login}/>
                <Route exact path="/register" component={Register}/>
                //전달할 props가 있는 경우 아래와 같이
                {/*<Route exact path="/info" render={() => <Info userInfo={userInfo} />} />*/}
            </Switch>
        </BrowserRouter>
    );
}

